  [],\n\t\"revision_timestamp\": \"2016-07-27T22:44:55.305060\",\n\t\"name\": \"2008-usfws-region-5-refuges-native-bee-study-final-report\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report describes the results of a
  bee survey coordinated by Leo Shapiro under contract with USFWS, working in close
  collaboration with Sam Droege of Patuxent Wildlife Research Center (USGS). We had
  two main goals for this pilot survey of native bees on selected USFWS Region 5 units:(1)
  Obtain initial assessments of bee species richness and diversity on fields across
  Region 5 refuge properties.(2) Establish and test protocols for large-scale bee
  sampling using geographically distributed volunteers. The appropriateness and practicality
  of both our statistical sampling design and our methods for handling the mechanics
  of processing, identifying, and databasing a large flow of samples must be demonstrated
  before we scale up further.  One question of particular interest was whether four
  fields elected and sampled on a refuge by volunteers could reasonably be treated
  as statistical replicate samples from that refuge.\",\n\t\"license_title\": \"License
